// src/pages/ContactUs.jsx
import React from "react";
import ContactForm from "../components/ContactForm";
import MapLeaflet from "../components/MapIframe";

export default function ContactUs(){
  const office = {position:[31.5204,74.3587], address:"123 Agritech Road, Lahore, Pakistan"};
  return (
    <main className="container" style={{paddingTop:28,paddingBottom:40}}>
      <h1 style={{color:"var(--accent)"}}>Contact Us</h1>
      <p className="meta">Questions about a product? Need technical support? Send us a message or visit our office.</p>

      <div style={{display:"grid",gridTemplateColumns:"1fr 380px",gap:18,marginTop:18}}>
        <div>
          <ContactForm />
        </div>

        <aside>
          <div style={{fontWeight:800}}>Office</div>
          <div className="meta" style={{marginBottom:10}}>123 Agritech Road, Lahore, Pakistan</div>
          <div style={{marginBottom:20}}>Phone: +92 300 1234567<br/>Email: info@soorajcrops.com</div>

          <div style={{height:260}}>
            <MapLeaflet position={office.position} zoom={13} address={office.address} />
          </div>
        </aside>
      </div>
    </main>
  );
}
